const Page = styled.div`
  width: 100dvw;
  height: 100dvh;
  position: relative;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  padding: 3rem;
  gap: 3rem;
  background-image: linear-gradient(to bottom, #2437cd, pink);

  & svg {
    width: 40%;
    height: 40%;
  }
`;

const Title = styled.h2`
  position: absolute;
  top: 20%;
  left: 60%;
  font-size: 5rem;
  color: white;
`;

const StartAnimate = keyframes`
  0% { 
  opacity: 0.3;
  }
  50%{
  opacity: 1;
  }
  100% { 
  opacity: 0.3;
  }
`;

const Pinkstart = styled.path`
  animation: ${StartAnimate} 3s infinite;
`;

const Greenstart = styled.path`
  animation: ${StartAnimate} 5s infinite;
`;

const PlanetAnimate = keyframes`
  from { 
  transform: rotateY(0deg);
  };
  to {
  transform:  rotateY(360deg);
  }

`;

const Planet = styled.g`
  transform-box: fill-box;
  transform-origin: center;
  animation: ${PlanetAnimate} 3s infinite;
`;

